import * as react from 'react';
import {
  Checkbox,
  FormControlLabel,
  FormGroup,
  Grid,
  Stack,
  Card,
  CardHeader,
  CardContent,
  Container,
  Paper,
  Divider,
  Typography,
} from '@mui/material';

const PPET: string[] = [
  'Helmet',
  'Mask',
  'Reflective Vest',
  'Safety Gloves',
  'Goggles',
  'Safety Boots',
];

export default function AlertSettings(): React.ReactElement {
  return (
    <Container maxWidth={'md'} sx={{ flex: 1, display: 'flex' }}>
      <Card sx={{ flex: 1 }}>
        <CardHeader title={'Alert&Notifications Settings'} />
        <Divider />
        <CardContent>
          <Grid container sx={{ flex: 1 }} direction="column">
            <Grid size={{ xs: 12 }}>
              <Typography> PPE Type</Typography>
              <Grid container spacing={1}>
                <FormGroup>
                  {PPET.map((p, index) => (
                    <FormControlLabel
                      key={p}
                      label={p}
                      control={<Checkbox />}
                      sx={{ pl: 2 }}
                    />
                  ))}
                </FormGroup>
              </Grid>
            </Grid>
            <Grid size={{ xs: 12 }}>notification</Grid>
            <Grid size={{ xs: 12 }}>save</Grid>
          </Grid>
        </CardContent>
      </Card>
    </Container>
  );
}
